// Columns height alignment

var currentTallest = 0;
var currentRowStart = 0;
var rowDivs = [];

function getOriginalHeight(el) {
    return el.find('.article').outerHeight();
}

function setHeight(rowDivs, currentTallest){
    if(rowDivs.length > 1){

        var areAllArticlesImages = true;
        for(currentDiv = 0 ; currentDiv < rowDivs.length ; currentDiv++){
            if(rowDivs[currentDiv].find('.article:not(.article-type-image)').length !== 0)
                areAllArticlesImages = false;
        }

        if(!areAllArticlesImages)
            for(currentDiv = 0 ; currentDiv < rowDivs.length ; currentDiv++){
                rowDivs[currentDiv].find('.article').outerHeight(currentTallest);
            }
    }
}

var columnConform = function (resize) {

    if(resize)
        $('.article').each(function(index) {
            $(this).height('auto');
        });

    // find the tallest DIV in the row, and set the heights of all of the DIVs to match it.
    $('.article-container').each(function(index) {

        if(currentRowStart != $(this).position().top) {

            // we just came to a new row.  Set all the heights on the completed row
            setHeight(rowDivs, currentTallest);

            // set the variables for the new row
            rowDivs.length = 0; // empty the array
            currentRowStart = $(this).position().top;
            currentTallest = getOriginalHeight($(this));
            rowDivs.push($(this));

        } else {

            // another div on the current row. Add it to the list and check if it's taller
            rowDivs.push($(this));
            currentTallest = (currentTallest < getOriginalHeight($(this))) ? (getOriginalHeight($(this))) : (currentTallest);

        }
        // do the last row
        setHeight(rowDivs, currentTallest);
    });
};

$(function(){

    $('a.anchor-link[href*="#"]:not([href="#"])').click(function() {
        if (location.pathname.replace(/^\//,'') == this.pathname.replace(/^\//,'') && location.hostname == this.hostname) {

            var target = $(this.hash);
            target = target.length ? target : $('[name=' + this.hash.slice(1) +']');
            var navbarHeight = $('.navbar-default').height();
            if (target.length) {
                $('html, body').animate({
                    scrollTop: target.offset().top - navbarHeight
                }, 1000);
                return false;
            }
        }
    });
});


$(window).resize(function() {
    columnConform(true);
});

function isSecure() {
    return window.location.protocol == 'https:';
}
var app = angular.module('app', ['controllers', 'factories', 'ngSanitize', 'ngRoute']);

var controllers = angular.module('controllers', []);

var factories = angular.module('factories', ['ngResource']);


app.config(['$routeProvider', function($routeProvider) {
	$routeProvider.
	when('/category', {
		controller: 'homeCtrl',
		templateUrl: 'partials/category.html'
	}).
	when('/events', {
		controller: 'eventsCtrl',
		templateUrl: 'partials/events.html'
	}).
	when('/events/:id/:url', {
		controller: 'eventsCtrl',
		templateUrl: 'partials/eventDetails.html'
	}).
    otherwise({
        redirectTo: '/',
        controller: 'homeCtrl',
		templateUrl: 'partials/home.html'
    });

}]);
controllers.controller('pageCtrl', ['$scope', '$location', function ($scope, $location){

    $scope.isActive = function (slug) {
        var active = (slug === $location.path());
        return active;
    };

}]);
controllers.controller('homeCtrl', ['$scope', '$timeout', 'getData', function ($scope, $timeout, getData){

    var dataTypes = ['articles', 'categories', 'subcategories'];

    // creating promises
    var dataTypesPromises = [];
    angular.forEach(dataTypes, function(dataType, key) {
        dataTypesPromises.push(getData(dataType));
    });

    Promise.all(dataTypesPromises).then(function(contentTypes) {
        $scope.$apply(function () {

            // creating scopes
            angular.forEach(contentTypes, function(contentType, k) {
                $scope[dataTypes[k]] = contentType.data;
            });

            // populate subcategories into categories
            angular.forEach($scope.categories, function(category, key) {

                category.subcategories = [];
                angular.forEach(category.subcategoriesIDs, function(catSubcategory, key) {

                    angular.forEach($scope.subcategories, function(subcategory, key) {
                        if(catSubcategory === subcategory.id)
                            category.subcategories.push(subcategory);
                    });
                });
            });

            //populate category color into article
            angular.forEach($scope.articles, function(article, key) {

                angular.forEach($scope.categories, function(category, key) {
                    if(article.categoriesIDs[0] === category.id)
                        article.category = category;
                });
            });
        });
    });

    $scope.selectedSubcategories = [];

    $scope.filterSubcategory = function(subcategory){

        if($scope.selectedSubcategories.indexOf(subcategory) !== -1){
            var index = $scope.selectedSubcategories.indexOf(subcategory);
            $scope.selectedSubcategories.splice(index, 1);

            subcategory.selected = false;
        }else{
            $scope.selectedSubcategories.push(subcategory);

            subcategory.selected = true;
        }

        $timeout(function () {
            columnConform(true);
        }, 500);
    };

    $scope.unselectSubcategory = function(subcategory){
        subcategory.selected = false;
        var index = $scope.selectedSubcategories.indexOf(subcategory);
        $scope.selectedSubcategories.splice(index, 1);

        $timeout(function () {
            columnConform(true);
        }, 500);
    };

    $scope.resetSubcategoriesFilters = function(){

        angular.forEach($scope.selectedSubcategories, function(selectedSubcategory, key) {
            selectedSubcategory.selected = false;
        });
        $scope.selectedSubcategories = [];

        $timeout(function () {
            columnConform(true);
        }, 500);
    };

    $scope.subcategoriesFilter = function(article) {

        var selectedArticle = false;

        if($scope.selectedSubcategories.length === 0)
            return article;

        angular.forEach(article.subcategories, function(articleSubcategory, key) {
            angular.forEach($scope.selectedSubcategories, function(selectedSubcategory, key) {
                if(articleSubcategory === selectedSubcategory.id){
                    selectedArticle = true;
                }
            });
        });

        if(selectedArticle)
            return article;
    };

    var sizes = {
        1 : 4,
        2 : 8,
        3 : 12
    };

    $scope.articleSize = function(articleWidth){

        var classes = 'col-sm-' + sizes[articleWidth] + ' col-md-' + sizes[articleWidth];
        return classes;
    };
}]);
controllers.controller('eventsCtrl', ['$scope', '$timeout', '$routeParams', 'getData', function ($scope, $timeout, $routeParams, getData){

    var dataTypes = ['events'];

    // creating promises
    var dataTypesPromises = [];
    angular.forEach(dataTypes, function(dataType, key) {
        dataTypesPromises.push(getData(dataType));
    });

    Promise.all(dataTypesPromises).then(function(contentTypes) {
        $scope.$apply(function () {

            // creating scopes
            angular.forEach(contentTypes, function(contentType, k) {
                $scope[dataTypes[k]] = contentType.data;
            });

            angular.forEach($scope.events, function(event, k) {
                if(event.id === parseInt($routeParams.id)){
                    $scope.selectedEvent = event;
                }
            });
        });
    });
}]);
factories.factory('getData', ['$http', function($http){

    return function(content){
       return $http.get('data/' + content + '.json');
    };

}]);
app.directive('articlesInit', ['$timeout', function($timeout){
	return {
		link: function(scope, element, attrs){

			if (scope.$last){
				$timeout(function () {
					columnConform();
				}, 300);
			}
		}
	};
}]);
app.directive('videoBrightcove', ['$timeout', function($timeout) {
	return {
		restrict: 'C',
		link: function postLink(scope, element, attrs) {

			scope.$watch('event.brightcoveVideoId', function(){

				var videoTemplate = '<object id="' + attrs.objectId + '" class="BrightcoveExperience"">' +
					'<param name="bgcolor" value="#000000">' +
					'<param name="height" value="360">' +
					'<param name="playerID" value="' + attrs.objectId + '">' +
					'<param name="playerKey" value="AQ~~,AAABFr5dtuk~,GrdDxOUKpFCMyoNW2ER2OZJAjgBWSH9M">' +
					'<param name="isVid" value="true">' +
					'<param name="isUI" value="true">' +
					'<param name="dynamicStreaming" value="true">' +
					'<param name="autoStart" value="false">' +
					'<param name="wmode" value="transparent">' +
					'<param name="dynamicStreaming" value="true" />' +
					'<param name="htmlFallback" value="true" />' +
					'<param name="@videoPlayer" value="' + attrs.videoId + '">';

					if(isSecure()){
						videoTemplate += '<param name="secureConnections" value="true" />' +
							'<param name="secureHTMLConnections" value="true" />';
					}

				videoTemplate += '</object>';

				element.html(videoTemplate);

				return $timeout(function() {
					return brightcove.createExperiences();
				});
			});
		}
	};
}]);
app.directive('sliderInit', ['$timeout', function($timeout) {
    return {
        link: function(scope, element, attrs){
            $timeout(function(){
                $('.slider').slick({
                    dots: true,
                    adaptiveHeight: true,
                    /*autoplay: true,
                    autoplaySpeed: 7000,*/
                    responsive: [{
                        breakpoint: 768,
                        settings: {
                            arrows: false
                        }
                    }]
                });
            }, 100);
        }
    };
}]);